The splendor of the mountains always takes my breath away. To me there's nothing better than an early morning with views like these. Thanks for being so beautiful Alberta.

It's been an amazing opportunity to explore and shoot around Southern Alberta with @photojbartlett and @travelalberta. My favorite part about about travel is meeting awesome people like Jeff. Truly a great dude! As for the film, I'm excited for all the footage I was able to capture and I can't wait to share. Now to hunker down in the camper and get to editing. We'll be based a few spots around Alberta while I work, so if you're around let me know! #camplife #wearestillwild

